Description:
This breathable, lightweight yarn is perfect for making beautiful summer sweaters, cardigans, and tank tops. Mostly composed of flax (another term for linen), it is great for any project especially machine knitting and weaving, as well as hand knitting and crocheting. Linen comes in a variety of weights and textures, and flax is one of them.

This is a lovely natural yarn for hand dyeing projects and will be great for space dyeing or variegating.

&nbsp;

<strong>Contents:</strong>&nbsp;40% Flax | 31% Cotton | 29% Rayon

<strong>Weight:&nbsp; Metallic , </strong>1 lb per cone - <strong>Plain,&nbsp;</strong>0.7-0.9 lb per cone

<strong>YPP:&nbsp;</strong>1360&nbsp;

<strong>WPI: [plain]</strong> 17 wraps per inch (lace)<strong> [metallic<span style="text-decoration: underline;">]</span></strong>&nbsp;14 wraps per inch (fingering)

&nbsp;

<strong>Priced per cone.</strong>

