This 100% fine rayon chenille yarn is perfect for a light weight and drapy scarves, cowl (sample below), sweater, wrap or throw - machine knit or used as a weft chenille yarn in weaving. It is a flat chenille yarn and we did not find issues when working with it on our knitting machine although care must be used with tension to avoid breakage. This is why we do not recommend this chenille yarn as warp.

