These metallic yarns are perfect for holding with another yarn to give your projects an extra bit of glitz for hand or machine knitters and adding some shine to handwoven items as well. Try holding one strand with your regular working yarn on your next project!

For Spinners- The metallic yarn would be perfect for adding as a ply in handspun yarns to add an effect without having to deal with spinning Angelina or Mylar fibers into your yarn. We recommend sampling with the metallic yarn and your single plies first to make sure your twist and shrink rate of your fiber accommodates the metallic yarn (without it ‘popping’ out of the finished yarn). &nbsp;We find using it as a core and twisting the plies with it works best.

<strong>Contents:</strong>&nbsp;50% metalized polyester | 50% nylon

<strong>Weight:</strong>&nbsp;0.4 lbs per spool

<strong>YPP:</strong>&nbsp;24,000&nbsp;

<strong>WPI:</strong>&nbsp;80&nbsp;

