Nature's Wool&nbsp;is a collection&nbsp;of fingering weight wool. The yarn is twisted and dyed at our mill here in Philadelphia, PA our wool is sourced domestically. The colors of this line were inspired by the rich various colors, present in crystals and minerals. Nature's Wool is a lovely yarn for sock knitting because it is so soft and buttery to the touch. It is a perfect yarn for a light weight shrug, scarf, or cape. &nbsp;It is also ideal for color-work such as Fair Isle, cabling, and lace work as well. &nbsp;Nature's Wool&nbsp; has a soft and bouncy hand it is truly a pleasure to work with.This unique yarn can be used in place of any fingering weight superwash yarn. &nbsp;We believe the&nbsp;alluring feel of natural wool was too&nbsp;good to superwash away!

<a href="https://www.madeinamericayarns.com/product/wayfarer-yarn/">Also available on skein!</a>

